@import '../../css/element.scss';
.panel{
    @include panel;
    margin-bottom: 100px;
    &>h4{
        display: none;
    }
    .content{
        @include flex;
        background: #f5f5f5;
        li{
            width: 100%;
            text-align: center;
            color: #999;
            font-size: 24px;
            >img{
                width: 100%;
                height: 143px;
            }
            &:nth-child(2){
                @include flex(row);
                height: 186px;
                box-sizing: border-box;
                >div{
                    width: 33.333%;
                    text-align: center;
                    box-sizing: border-box;
                    margin-top: 20px;
                    img{
                        width: 90px;
                        height: 90px;
                    }
                    p{
                        font-size: 26px;
                        text-align: center;
                        display: block;
                        color: #999;
                        margin-top: 12px;
                        white-space: nowrap;
                        text-overflow: ellipsis;
                        overflow: hidden;
                    }
                }
            }
            &:nth-child(n+3){
                padding: 24px 0;
                height: 38px;
                line-height: 38px;
                border-top: 1px solid #ddd;
            }
        }
    }
}
